商品名：栗山米菓 アンパンマンのソフトせんべい 2枚×16袋 × 12 個セット<br>商品説明<br>軽い歯ざわりの甘口しょうゆ味のソフトせんべいです。 <br>味付けには化学調味料（アミノ酸等）を使用しておりません。 オリゴ糖を配合しています。<br><br>表示内容量 2枚×16袋<br><br>原材料<br>うるち米(国産）、植物油脂、でん粉、砂糖、粉末しょう油（小麦・大豆を含む）、フラクトオリゴ糖、食塩<br><br>表示栄養成分（製品100g当り）<br>エネルギー　470kcal<br>たんぱく質　5.1g<br>脂質　16.6g<br>炭水化物　75.1g<br>ナトリウム　561mg<br>フラクトオリゴ糖　200mg<br>食塩相当量　1.43g<br><br>備考<br>1個装（２枚）当り　30.0kcal<br><br>【おうちの方へ】<br>・おせんべいが、お子様ののどにつまらないように、ご注意ください。<br>・ひとりで食べられない場合は、適当な大きさに割って食べさせてあげてください。<br><br>(食品　離乳食　赤ちゃん　おやつ　せんべい　成長　あかちゃん　おせんべい　お菓子　おかし)<br>JANコード：4901336110530<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
